import React from 'react';
import MainLayout from '../layout/Mainlayout';

function Podcasts() {
  return (
    <>
      <MainLayout children={Podcasts}>
        <div>Podcasts</div>
      </MainLayout>
      <br />
      <p>Click on the link below to see some of my favorite Podcasts.</p>
      <a href="https://baconsale.com/">https://baconsale.com/</a>
    </>
  );
}

export default Podcasts;
